"use strict";

function quabonacci(n) {
  if (n === 0 || n === 1) return n;
  if (n === 2) return 1;
  if (n === 3) return 2;

  let a = BigInt(0);
  let b = BigInt(1);
  let c = BigInt(1);
  let d = BigInt(2);
  let x;

  while (n > 3) {
    n--;
    x = a + b + c + d;
    a = b;
    b = c;
    c = d;
    d = x;
  }

  return d;
}

console.log(quabonacci(1000));

